import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import api from "../utils/api";
import { FaClock, FaStar, FaSpinner, FaExclamationTriangle } from "react-icons/fa";
import "./mytests.css";

export default function MyTests() {
  const [tests, setTests] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchTests = async () => {
      try {
        setLoading(true);
        setError(null);
        
        // Try multiple possible endpoints
        const possibleEndpoints = [
          "/student/tests",
          "/api/student/tests", 
          "/tests",
          "/api/tests"
        ];
        
        let data = null;
        let successfulEndpoint = null;
        
        for (const endpoint of possibleEndpoints) {
          try {
            console.log(`Trying endpoint: ${endpoint}`);
            const response = await api.get(endpoint);
            data = response.data;
            successfulEndpoint = endpoint;
            console.log(`Success with endpoint: ${endpoint}`, data);
            break;
          } catch (endpointError) {
            console.log(`Failed with endpoint ${endpoint}:`, endpointError.response?.status);
            continue;
          }
        }
        
        if (!data) {
          throw new Error("All API endpoints failed. Please check your backend server and routes.");
        }
        
        console.log("Raw API response:", data);

        // Handle different response formats
        let testsArray = [];
        if (Array.isArray(data)) {
          testsArray = data;
        } else if (data.tests && Array.isArray(data.tests)) {
          testsArray = data.tests;
        } else if (data.data && Array.isArray(data.data)) {
          testsArray = data.data;
        } else {
          console.warn("Unexpected data format:", data);
          testsArray = [];
        }

        console.log("Tests array:", testsArray);

        const formattedTests = testsArray.map((test, index) => {
          console.log(`Formatting test ${index}:`, test);
          return {
            id: test._id || test.id,
            name: test.name || test.testName || "Untitled Test",
            duration: test.duration || 30,
            totalMarks: test.totalMarks || 0,
          };
        });

        console.log("Formatted tests:", formattedTests);
        setTests(formattedTests);
      } catch (err) {
        console.error("Failed to fetch tests:", err);
        let errorMessage = "Failed to load tests";
        
        if (err.response) {
          // Server responded with error status
          errorMessage = err.response.data?.message || `Server error: ${err.response.status}`;
        } else if (err.request) {
          // Request was made but no response received
          errorMessage = "Unable to connect to server. Please check if the server is running.";
        } else {
          // Something else happened
          errorMessage = err.message || "An unexpected error occurred";
        }
        
        setError(errorMessage);
      } finally {
        setLoading(false);
      }
    };

    fetchTests();
  }, []);

  const takeTest = (test) => {
    console.log("Taking test:", test);
    navigate(`/take-test/${test.id}`, { state: { test } });
  };

  const colors = ["#fef3c7", "#d1fae5", "#dbeafe", "#f0e6ff"];

  if (loading) {
    return (
      <div className="mytests-container">
        <div className="loading-container">
          <FaSpinner className="spinner" />
          <p>Loading available tests...</p>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="mytests-container">
        <div className="error-container">
          <FaExclamationTriangle className="error-icon" />
          <h2>Unable to Load Tests</h2>
          <p>{error}</p>
          <button 
            className="retry-btn" 
            onClick={() => window.location.reload()}
          >
            Try Again
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="mytests-container">
      <div className="mytests-header">
        <h1 className="mytests-page-title">Available Tests</h1>
        <p className="mytests-page-subtitle">Select a test to start your practice</p>
      </div>

      <div className="mytests-grid">
        {tests.length === 0 ? (
          <div className="no-tests">
            <p>No tests available at the moment.</p>
            <p>Please check with your administrator.</p>
          </div>
        ) : (
          tests.map((test, index) => (
            <div
              key={test.id}
              className="mytest-card"
              style={{ backgroundColor: colors[index % colors.length] }}
            >
              <h2 className="mytest-name">{test.name}</h2>
              <div className="mytest-details">
                <div className="mytest-detail-item">
                  <FaClock />
                  <span className="mytest-detail-label">Duration:</span>
                  <span className="mytest-detail-value">{test.duration} min</span>
                </div>
                <div className="mytest-detail-item">
                  <FaStar />
                  <span className="mytest-detail-label">Max Marks:</span>
                  <span className="mytest-detail-value">{test.totalMarks}</span>
                </div>
              </div>
              <button className="take-test-btn" onClick={() => takeTest(test)}>
                Take Test
              </button>
            </div>
          ))
        )}
      </div>
    </div>
  );
}
